import { useState } from "react";

function App() {
  const [n, setN] = useState(0);

  function submit() {
    setN(current => current + 1)
  }

  return (
    <>
      <h3>구구단</h3>
      <form onSubmit={submit}>
        <input type="number" min="1" max="9" readOnly />
        *
        <input type="number" min="1" max="9" readOnly />
        =
        <input type="number" min="1" max="9" />
        <button style={{display:"none"}}>버튼</button>
      </form>
    </>
  );
}

export default App;
